    render(){
        return(
            <div className="card">
                <div className="container">
                    <h3>Total:</h3>
                    <div className="p-3 mb-2 bg-info text-white text-center">
                        S/.2000
                    </div>
                    <div className="container">
                        <h6>SUB TOTAL: S/.2500.00</h6>
                        <h6>IGV(18%): S./5000.00</h6>
                        <h6>TOTAL: S./7500.00</h6>
                    </div>
                </div>
               
            </div>
        );
    }
}

export default Reportes;
